import { Container, LinkContainer, Navbar, Nav } from "react-bootstrap";
import { Router, Routes, Route, Link } from "react-router-dom";
import Films from "./Films";
import Actors from "./Actors";

function NavigationBar() {
    return (
    <Router>
        <Navbar bg="dark" variant="dark">
            <Container fluid>
                <LinkContainer><Nav.Link as={Link} to={"/films"}>Films</Nav.Link></LinkContainer>
                <LinkContainer><Nav.Link as={Link} to={"/actors"}>Actors</Nav.Link></LinkContainer>
            </Container>
        </Navbar>

        <Routes>
            <Route exact path="/films">
                <Films></Films>
            </Route>
            <Route exact path="/actors">
                <Actors />
            </Route>
        </Routes>
    </Router>
    )
}

export default NavigationBar
